/* HUD widget that displays worn inventory of a single player
   It is activated through the main HUD and replaces the message box */
function Inventorywidget(hud_instance)
{
	this.hud = hud_instance;
	this.party = Party;
	this.active = false;
	this.current_party_member = -1;
}

Inventorywidget.prototype.render = function(party_member = -1)
{
	/* A zero+ value for party_member changes the active render target
	   Otherwise, we continue with the last target */
	if (party_member > -1) { this.current_party_member = party_member; }

	/* There are no party members */
	if (this.current_party_member === -1) { return false; }
	
	/* Clear the current window */
	this.clear_message_window();
	
	/* An alias to the party member we're viewing */
	var current = Party.member[this.current_party_member];
	
	/* Display equipment currently worn */
	this.render_line(1, current.name + " is using: ");
	this.render_line(2, "Weapon: " + this.get_item_name(current.inventory.wear, WEAR_WIELD_SINGLE) );
	this.render_line(3, "Head: " + this.get_item_name(current.inventory.wear, WEAR_HEAD) );
	this.render_line(4, "Body: " + this.get_item_name(current.inventory.wear, WEAR_BODY) );
	this.render_line(5, "Feet: " + this.get_item_name(current.inventory.wear, WEAR_FEET) );
	this.render_line(6, "Hands: " + this.get_item_name(current.inventory.wear, WEAR_HANDS) );
	this.render_line(7, "Neck: " + this.get_item_name(current.inventory.wear, WEAR_NECK) );
	this.render_line(8, "Cloak: " + this.get_item_name(current.inventory.wear, WEAR_CLOAK) );
	this.render_line(9, "Finger: " + this.get_item_name(current.inventory.wear, WEAR_FINGER) );
	
	this.hud.inventory_dirty = false;
};

Inventorywidget.prototype.clear_message_window = function() {
	animation_context.clearRect(this.hud.message_box_x,this.hud.message_box_y,this.hud.message_box_width,this.hud.message_box_height);
};

Inventorywidget.prototype.render_line = function(line, message) {
	var font_size = Math.max(Math.round(this.hud.status_bar_height*0.60),12);
	animation_context.font = font_size+"px Courier";
	animation_context.fillStyle = FG_COLOR;
	animation_context.textAlign = "left";
	animation_context.fillText(message,this.hud.message_box_x+5,this.hud.message_box_y+font_size+(line-1)*font_size);
}

Inventorywidget.prototype.get_item_name = function(who, what)
{
	/* Who's on first?? ...yeah this was typed after probably 500 lines of code today */
	if (!who[what]) { return "none";}
	return who[what].name;
}
 
function Message(hud_instance) {
	var i;
	this.hud = hud_instance; /* save parent pinter */
	
	for (i=0; i<this.message_buffer_size; i++) {
		this.message_log.push(""); 
	}
	
	this.message_index = this.message_buffer_size-1;
	this.message_rows = Math.round(this.hud.message_box_height/BASE_FONT_SIZE)-1;
	
	/* The message box competes for space with other widgets */
	this.active = true;
}

Message.prototype.message_buffer_size = 64;
Message.prototype.message_log = [];
Message.prototype.hud = 0; /* parent pointer unknown during prototyping */

Message.prototype.render = function() {
	
	if (!this.active) { return; }
	
	var i;
	var num = this.message_index;
	var font_size = Math.max(Math.round(this.hud.status_bar_height*0.60),12);
	this.message_rows = Math.round(this.hud.message_box_height/font_size)-1;
	this.clear_message_window();
	for (i=0; i<this.message_rows; i++) {
		animation_context.font = font_size+"px Courier";
		animation_context.fillStyle = FG_COLOR;
		animation_context.textAlign = "left";
		animation_context.fillText(this.message_log[num],this.hud.message_box_x+5,this.hud.message_box_y+font_size+i*font_size);	
		num = (++num) % this.message_buffer_size;
	}
	
	this.hud.message_dirty = false;
};

Message.prototype.clear_message_window = function() {
	animation_context.clearRect(this.hud.message_box_x,this.hud.message_box_y,this.hud.message_box_width,this.hud.message_box_height);
};

Message.prototype.add_message = function(msg) {
	this.message_index--;
	
	if (this.message_index < 0) {
		this.message_index = this.message_buffer_size-1;
	}
	
	this.message_log[this.message_index] = msg;
	this.hud.message_dirty = true;
	this.hud.dirty = true;
	Hud.render();
};
 
function Partywidget(hud_id, new_id) 
{
	this.partymember_id = new_id;
	this.hud = hud_id;
	this.party = Party;
	this.dirty = true;
}

/* Hud object reference */
Partywidget.prototype.hud = 0;
/* Party object reference */
Partywidget.prototype.party = 0;

Partywidget.prototype.clear_partymember = function() 
{
	var xx = this.hud.avatar_box_x[this.partymember_id];
	var yy = this.hud.avatar_box_y;
	var ww = this.hud.avatar_box_width;
	var hh = this.hud.avatar_box_height;
	animation_context.clearRect(xx,yy,ww,hh);
};

Partywidget.prototype.render = function() 
{	
	if (this.dirty) {
		var xx = this.hud.avatar_box_x[this.partymember_id] + this.hud.avatar_box_width/2;
		var yy = this.hud.avatar_box_y + Math.round(this.hud.avatar_box_height*0.6);
		var font_size = Math.round(this.hud.avatar_box_height*0.8)+"px Sans-Serif";
		
		var color = this.get_hud_color(this.party, this.partymember_id);
		
		var hp_bar_width = Math.round(this.party.member[this.partymember_id].current_hp/this.party.member[this.partymember_id].max_hp*this.hud.avatar_box_width);
			hp_bar_width = Math.max(hp_bar_width,0);
		var hp_bar_height = Math.round(this.hud.avatar_box_height*0.04);
		var hp_bar_x = this.hud.avatar_box_x[this.partymember_id];
		var hp_bar_y = Math.round(this.hud.avatar_box_y+this.hud.avatar_box_height*0.85);
		
		var mp_bar_width = Math.round(this.party.member[this.partymember_id].current_mp/this.party.member[this.partymember_id].max_mp*this.hud.avatar_box_width);
		var mp_bar_height = Math.round(this.hud.avatar_box_height*0.04);
		var mp_bar_x = this.hud.avatar_box_x[this.partymember_id];
		var mp_bar_y = Math.round(this.hud.avatar_box_y+this.hud.avatar_box_height*0.92);
		
		
		/* Draw @ sign */
		this.clear_partymember();
		animation_context.fillStyle = color;
		animation_context.textAlign = "center";
		animation_context.font = font_size;
		animation_context.fillText("@", xx, yy);
		this.dirty = false;
		
		/* Draw HP bar */
		animation_context.fillStyle = this.health_bar_color(this.hud.avatar_box_width, hp_bar_width);
		animation_context.fillRect(hp_bar_x,hp_bar_y,hp_bar_width,hp_bar_height);
		
		/* Draw MP bar */
		animation_context.fillStyle = "rgb(0,0,240)";
		animation_context.fillRect(mp_bar_x,mp_bar_y,mp_bar_width,mp_bar_height);
	}
};

Partywidget.prototype.get_hud_color = function(party, id) 
{
	/* Set default to normal and short circuit based on status priority */
	var color = "rgb(224,224,224)";
	
	if (party.member[id].status & STATUS_DEAD) { return "rgb(0,0,0)"; }	
	if (party.member[id].status & STATUS_UNCONCIOUS) { return "rgb(96,0,0)"; }	
	if (party.member[id].status & STATUS_POISONED) { return "rgb(160,160,92)"; }	
	if (party.member[id].current_delay > 0) { return "rgb(160,160,160)"; }
	if (id == party.active_partymember) { return "rgb(128,240,128)"; }
	
	return color;
};

Partywidget.prototype.health_bar_color = function(full_width, current_width) 
{
	if (current_width / full_width < 0.25) { return "rgb(240,0,0)"; }
	if (current_width / full_width < 0.50) { return "rgb(240,240,0)"; }
	return "rgb(0,240,0)";
};
 
