Party.prototype.member = [];

Party.prototype.is_incapacitated = function(party_member) 
{
	return (this.member[party_member].status & (STATUS_DEAD | STATUS_UNCONCIOUS | STATUS_ASLEEP | STATUS_PARALYZED | STATUS_ERADICATED)); 
};

Party.prototype.is_ready = function(party_member) 
{
	return (this.member[party_member].current_delay === 0 && !this.is_incapacitated(party_member)); 
};
	
Party.prototype.is_party_dead = function() 
{
	if (this.is_incapacitated(0) && this.is_incapacitated(1) && this.is_incapacitated(2) && this.is_incapacitated(3)) {
		return true; 
	}
	
	return false;
};

/* Interface to add experience to party members */
Party.prototype.add_xp = function(xp_amount) 
{
	var i;
	
	for (i=0; i<4; i++) {
		if (!this.is_incapacitated(i)) {
			this.member[i].xp += xp_amount; 
		}
	}
};
	
/* Interface to damage party members */
Party.prototype.damage_party = function(attacker, damage_amount, target = -1, damage_type = DAM_PHYSICAL) 
{
	if (this.is_party_dead()) { return false; }
	
	/* Pick a party member at random */
	if (target == -1) {
		target = Math.floor(Math.random()*3.99);
		
		while (this.is_incapacitated(target)) {
			target = Math.floor(Math.random()*3.99); 
		}
	}
	
	this.member[target].current_hp -= damage_amount;
	
	if (this.member[target].current_hp <= 0) { 
		this.member[target].status |= STATUS_UNCONCIOUS; 
	}
		
	if (this.member[target].current_hp <= -25) {
		this.member[target].status |= STATUS_DEAD; 
	}
		
	if (this.member[target].current_hp <= -100) {
		this.member[target].status |= STATUS_ERADICATED; 
	}
	
	Hud.partywidget[target].dirty = true;
	
	if (attacker != -1) { 
		Hud.message.add_message(attacker.name + Player.get_damage_action(damage_type) + this.member[target].name + " for " + damage_amount); 
	}
};

/* Tick the party delay counter */
Party.prototype.reduce_delay = function(amount = 1)
{
	var i;
	
	for (i=0; i<4; i++)
	{
		Party.member[i].current_delay -= amount;
		if (Party.member[i].current_delay === 0) {
			Hud.partywidget[i].dirty = true; 
		}
		Party.member[i].current_delay = Math.max(Party.member[i].current_delay, 0);
	}
};

/* Find a ready party member */
Party.prototype.find_ready_party_member = function() 
{
	var i;
	var current = Party.active_partymember;
	
	/* Check if active party member is legit */
	if (current != -1 && !this.is_ready(current)) { 
		current = -1; 
	}
	
	/* If someone is already active, keep them active */
	if (current != -1) { return current; }
	
	/* Find new party member */
	for (i=0; i<4; i++) {
		if (this.is_ready(i) && !this.is_incapacitated(i)) {
			Hud.partywidget[i].dirty = true;
			return i;
		}
	}
	/* If you get here, nobody must be ready */
	return -1;
};

/* Procedurally changes active party member and functionally returns the slot */
Party.prototype.change_active_party_member = function(next)
{	
	last = this.active_partymember;
	delay = this.member[next].current_delay;
	status = this.member[next].status;
	
	if (last == next) { return last; }
	
	if (this.is_ready(next) && !this.is_incapacitated(next)) { 
		this.active_partymember = next;
		if (last >= 0) { Hud.partywidget[last].dirty = true; }
		Hud.partywidget[next].dirty = true;		
		return next;
	}
	return last;
};

Party.prototype.get_xp_requirement = function (level) 
{
	if (level == 1) { return 0; }
	return 1000 * (level-1) + this.xp_requirement(level-1);
};

Party.prototype.fall_damage = function (height_difference) 
{
	var i, damage;
	for (i=0; i<4; i++) {
		damage = Math.round(-(height_difference+2)*Math.random()*0.25*Party.member[i].max_hp)+1;
		this.damage_party(-1, damage, i);
	}
	
	Hud.message.add_message("Waaaa...!");
};

Party.prototype.get_class = function(party_class)
{
	switch (party_class) {
		case CLASS_KNIGHT: return "Knight"; return;
		case CLASS_PALADIN:  return "Paladin"; return;
		case CLASS_ARCHERER: return "Archerer"; return;
		case CLASS_DRUID: return "Druid"; return;
		case CLASS_CLERIC: return "Cleric"; return;
		case CLASS_SORCERER: return "Sorcerer"; return;
	}
}

/* Holds all the data for a single party member */
function Partymember(party, id) 
{
	var i;
	
	this.party = party;
	this.id = id;
	
	this.status = 0 /* Status flags */
	this.xp = 0;
	this.level = 1;
	this.age = 20;
	this.spell_book = [];
	
	/* Skill arrays including separate modifier arrays
	   base is permanent, modifiers are temporary (spells/items) */
    this.skill= [];  this.skill_mods = [];
	this.stat = [];   this.stat_mods = [];
	this.resist = []; this.resist_mods = [];
	
	for (i=0; i<30; i++) {
		this.skill[i] = 0;  this.skill_mods[i] = 0;
		this.stat[i] = 0;   this.stat_mods[i] = 0;
		this.resist[i] = 0; this.resist_mods[i] = 0;
	}
	
	this.armor = 0;   this.armor_mods = 0;
	
	this.job = CLASS_ARCHERER;
	this.name = "Locke";
	
	this.max_hp = 10;
	this.current_hp = this.max_hp;
	this.max_mp = 10;
	this.current_mp = this.max_mp;
	
	this.base_delay = 10;
	this.current_delay = 0;
	
	this.melee_die_num = 2;
	this.melee_die_side = 3;
	this.melee_die_bonus = 1;
	
	this.ranged_die_num = 1;
	this.ranged_die_side = 3;
	this.ranged_die_bonus = 1;
	
	this.quick_spell = SPELL_NONE;
	
	for (i=0; i<30; i++) { this.skill[i] = 0; }
	for (i=0; i<6; i++) { this.stat[i] = 0; }
	for (i=0; i<6; i++) { this.resist[i] = 0; }
	
	this.inventory = new Inventory(this);
}

 
/* Contains Player specific properties and methods. Derived from the ACTOR prototype
   Check ACTOR for most of the movement-related interactions */
function Player() 
{
	Actor.call(this);
	
	this.name = "Your Party";
	this.avatar = "@";
	this.die_num = 2;
	this.die_side = 4;
	this.die_bonus = 1;
}

Player.prototype = Object.create(Actor.prototype);
Player.prototype.constructor = Player;
Player.prototype.threats = [];

/* Melee attack */
Player.prototype.execute_melee_attack = function(target) 
{
	if (Party.active_partymember === -1) { return false; }
	
	var i;
	var damage = 0;
	var party_member = Party.active_partymember;
	var die_num = Party.member[party_member].melee_die_num;
	var die_side = Party.member[party_member].melee_die_side;
	var die_bonus = Party.member[party_member].melee_die_bonus;
	var attacker = Party.member[party_member].name;
	var attack_type = DAM_PHYSICAL;
	
	for (i=0; i<die_num; i++) {
		damage += Math.round(Math.random()*(die_side-1)+1)+die_bonus;
	}
	
	if (damage > 0) { target.damage_actor(damage, this, attacker); }
	
	Party.member[party_member].current_delay = Party.member[party_member].base_delay;
	Hud.partywidget[party_member].dirty = true;
	Party.active_partymember = -1;
};

/* Ranged attack (bows) */
Player.prototype.execute_ranged_attack = function(target = 0)
{
	/* If nobody in the party is active, there is no attack */
	if (Party.active_partymember === -1) { return false; }
	
	/* Shortened property references from the Party objects */
	var i, shot;
	var damage = 0;
	var party_member = Party.active_partymember;
	var die_num = Party.member[party_member].ranged_die_num;
	var die_side = Party.member[party_member].ranged_die_side;
	var die_bonus = Party.member[party_member].ranged_die_bonus;
	var attacker = Party.member[party_member].name;
	var attack_type = DAM_PHYSICAL;
	
	/* Makes the die calculation */
	for (i=0; i<die_num; i++) {
		damage += Math.round(Math.random()*(die_side-1)+1)+die_bonus;
	}
	
	if (target) {
		shot = new Arrow(Player.map_x, Player.map_y, Math.point_direction(View.get_pxc(Player.map_x), View.get_pyc(Player.map_y), View.get_pxc(target.map_x), View.get_pyc(target.map_y)));
	} else {
		shot = new Arrow(Player.map_x, Player.map_y, Math.point_direction(View.get_pxc(Player.map_x), View.get_pyc(Player.map_y), mouse_x, mouse_y));
	}
	shot.from_player = true;
	shot.shooter = attacker;
	
	Party.member[party_member].current_delay = Party.member[party_member].base_delay;
	Hud.partywidget[party_member].dirty = true;
	Party.active_partymember = -1;
};

/* Cast attack spells */
Player.prototype.execute_cast_attack = function(target = 0)
{
	/* If nobody in the party is active, there is no attack */
	if (Party.active_partymember === -1) { return false; }
	
	var i, cost;
	var shot = 0;
	var damage = 0;
	
	var party_member = Party.active_partymember;
	var attacker = Party.member[party_member].name;
	
	var spell, i, shot, damage;
	
	/* Pull readied spell*/
	spell = Party.member[party_member].quick_spell;
	
	/* If no spell, skip turn */
	if (!spell) { return; }
	
	/* Check MP cost */
	cost = get_spell_cost(spell, this);
	
	if (Party.member[party_member].current_mp >= cost) {
		
		/* Get damage of spell from this caster */
		damage = get_spell_damage(spell, this);
		
		/* Make spell projectile and apply stats */
		shot = get_spell_shot(spell, this, target);
		
		if (shot) {
			shot.from_player = true;
			shot.shooter = attacker;
			shot.damage = damage;
			
			Party.member[party_member].current_mp -= cost;
			Party.member[party_member].current_delay = Party.member[party_member].base_delay;
			Hud.partywidget[party_member].dirty = true;
			Party.active_partymember = -1;
		}
	}
};

/* Auto-attack decision maker (A-key)*/
Player.prototype.execute_auto_attack = function()
{
	/* If nobody in the party is active, there is no attack */
	if (Party.active_partymember === -1) { return false; }
	
	/* If there's no threats nearby then there is no auto attack */
	if (!Player.threats.length) { return; }
	
	var i;
	var closest_enemy;
	var closest_distance = 20;
	
	/* Cycle through threat list and find the closest */
	/* This list is populated when monsters move every turn in the ACTOR object */
	for (i=0; i<this.threats.length; i++){
		if (this.threats[i].player_distance <= closest_distance) {
			closest_enemy = this.threats[i];
			closest_distance = closest_enemy.player_distance;
		}
	}
	
	/* Monsters adjacent to the player get a Melee attack */
	if (closest_distance < 2) {
		this.execute_melee_attack(closest_enemy);
	} else { 
		/* Check the current spell */
		var current_spell = Party.member[Party.active_partymember].quick_spell;
		var current_cost = get_spell_cost(current_spell, this)
		var current_mp = Party.member[Party.active_partymember].current_mp;
		
		/* If there is a ready and castable spell - use it, otherwise bow */
		if (current_spell && current_cost <= current_mp) {
			this.execute_cast_attack(closest_enemy);
		} else {
			this.execute_ranged_attack(closest_enemy);
		}
	}
		
}

/* Run a few fixed turn checks
   This happens after the player turn, but before monster turn */
Player.prototype.update_tick = function() 
{	
	/* Update delay values */
	Party.reduce_delay();
	
	/* Update active partywidget */
	Party.active_partymember = Party.find_ready_party_member();
	
	/* Clear current threats */
	Player.threats = [];
};
 
